import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import * as serviceWorker from './serviceWorker';

class Car extends React.Component {
    constructor() {
        super();
        this.state = {color: "red"};
    }

    render() {
      return <h2>Hi, I am a {this.state.color}Car!</h2>;
    }
}


